    "Input.html#addForwarder": {
      "id": "Input.html#addForwarder",
      "kind": "function",
      "title": "addForwarder( destinations [, options ] )  {Forwarder}",
      "longname": "Input#addForwarder",
      "name": "addForwarder",
      "tags": "Input#addForwarder addForwarder",
      "summary": "",
      "description": "Adds a forwarder that will forward all incoming MIDI messages matching the criteria to the specified output destination(s). This is akin to the hardware MIDI THRU port with the added benefit of being able to filter which data is forwarded."
    },
    "Input.html#addListener": {
      "id": "Input.html#addListener",
      "kind": "function",
      "title": "addListener( event, listener [, options ] )  {Array.&lt;Listener&gt;}",
      "longname": "Input#addListener",
      "name": "addListener",
      "tags": "Input#addListener addListener",
      "summary": "",
      "description": "Adds an event listener that will trigger a function callback when the specified event happens. The event can be channel-bound or input-wide. Channel-bound events are dispatched by InputChannel objects and are tied to a specific MIDI channel while input-wide events are dispatched by the Input object itself and are not tied to a specific channel. When listening for an input-wide event, you must specify the event to listen for and the callback function to trigger when the event happens: WebMidi.inputs[0].addListener(\"midimessage\", someFunction); To listen for a channel-bound event, you must also specify the event to listen for and the function to trigger but you have to add the channels you wish to listen on in the options parameter: WebMidi.inputs[0].addListener(\"noteon\", someFunction, {channels: [1, 2, 3]}); The code above will add a listener for the \"noteon\" event and call someFunction when the event is triggered on MIDI channels 1, 2 or 3. Note that, when adding events to channels, it is the InputChannel instance that actually gets a listener added and not the `Input instance. Note: if you want to add a listener to a single MIDI channel you should probably do so directly on the InputChannel object itself. There are 6 families of events you can listen to: MIDI System Common Events (input-wide) songposition songselect sysex timecode tunerequest MIDI System Real-Time Events (input-wide) clock start continue stop activesensing reset State Change Events (input-wide) opened closed disconnected Catch-All Events (input-wide) midimessage unknownmidimessage Channel Voice Events (channel-specific) channelaftertouch controlchange keyaftertouch noteoff noteon nrpn pitchbend programchange Channel Mode Events (channel-specific) allnotesoff allsoundoff localcontrol monomode omnimode resetallcontrollers NRPN Events (channel-specific) nrpndataentrycoarse nrpndataentryfine nrpndatabuttonincrement nrpndatabuttondecrement RPN Events (channel-specific) rpndataentrycoarse rpndataentryfine rpndatabuttonincrement rpndatabuttondecrement"
    },
    "Input.html#addOneTimeListener": {
      "id": "Input.html#addOneTimeListener",
      "kind": "function",
      "title": "addOneTimeListener( event, listener [, options ] )  {Array.&lt;Listener&gt;}",
      "longname": "Input#addOneTimeListener",
      "name": "addOneTimeListener",
      "tags": "Input#addOneTimeListener addOneTimeListener",
      "summary": "",
      "description": "Adds a one-time event listener that will trigger a function callback when the specified event happens. The event can be channel-bound or input-wide. Channel-bound events are dispatched by InputChannel objects and are tied to a specific MIDI channel while input-wide events are dispatched by the Input object itself and are not tied to a specific channel. When listening for an input-wide event, you must specify the event to listen for and the callback function to trigger when the event happens: WebMidi.inputs[0].addListener(\"midimessage\", someFunction); To listen for a channel-bound event, you must also specify the event to listen for and the function to trigger but you have to add the channels you wish to listen on in the options parameter: WebMidi.inputs[0].addListener(\"noteon\", someFunction, {channels: [1, 2, 3]}); The code above will add a listener for the \"noteon\" event and call someFunction when the event is triggered on MIDI channels 1, 2 or 3. Note that, when adding events to channels, it is the InputChannel instance that actually gets a listener added and not the `Input instance. Note: if you want to add a listener to a single MIDI channel you should probably do so directly on the InputChannel object itself. There are 6 families of events you can listen to: MIDI System Common Events (input-wide) songposition songselect sysex timecode tunerequest MIDI System Real-Time Events (input-wide) clock start continue stop activesensing reset State Change Events (input-wide) opened closed disconnected Catch-All Events (input-wide) midimessage unknownmidimessage Channel Voice Events (channel-specific) channelaftertouch controlchange keyaftertouch noteoff noteon nrpn pitchbend programchange Channel Mode Events (channel-specific) allnotesoff allsoundoff localcontrol monomode omnimode resetallcontrollers"
    },
